import { Link } from "react-router-dom";

export default function Profile() {
  const username = localStorage.getItem("username");

  return (
    <div className="min-h-screen bg-black text-white flex flex-col items-center justify-center px-6">
      <h1 className="text-6xl font-extrabold mb-6 text-center">Welcome, {username}!</h1>
      <p className="text-2xl mb-6 text-center">Explore your learning journey.</p>
      <Link
        to="/dashboard"
        className="px-8 py-4 bg-purple-700 hover:bg-purple-800 text-white text-2xl rounded-xl transition"
      >
        Go to Dashboard
      </Link>
    </div>
  );
}
